import "./App.css";
import React from "react";
import Navbar from "./components/Navbar/navbar";
import About from "./components/About/about";
import Home from "./components/Home/home";
import Project from "./components/Project/project";
import Experience from "./components/Experience/experience";
import { motion } from "framer-motion";
import Footer from "./components/Footer/footer";
import Codeforces from "./components/Codeforces/Codeforces";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

// Animation Stuffs
const NavbarVariant = {
  hidden: {
    y: "-10vh",
    opacity: 0,
  },
  visible: {
    y: "-3.5vh",
    opacity: 1,
    transition: {
      delay: 1.2,
      duration: 1.5,
      type: "spring",
      stiffness: 130,
    },
  },
};

const HomeVariant = {
  hidden: { x: "-100vw", y: "100vh" },
  visible: {
    x: "0vw",
    y: "4.6vh",
    transition: {
      delay: 0.7,
      duration: 1.5,
      type: "spring",
      stiffness: 70,
      // mass: 0.4,
      // damping: 8,
    },
  },
};

function App() {
  return (
    <>
      <Router>
        <motion.div variants={NavbarVariant} initial="hidden" animate="visible">
          <Navbar />
        </motion.div>
        {/* <motion.div variants={HomeVariant} initial="hidden" animate="visible">
          <Home />
        </motion.div> */}
        <Routes>
          <Route
            exact
            path="/"
            element={
              <motion.div
                variants={HomeVariant}
                initial="hidden"
                animate="visible"
              >
                <Home />
              </motion.div>
            }
          />
          <Route exact path="/about" element={<About />} />
          <Route exact path="/experience" element={<Experience />} />
          <Route exact path="/project" element={<Project />} />
          <Route exact path="/codeforces" element={<Codeforces />} />
          <Route exact path="/footer" element={<Footer />} />
        </Routes>
      </Router>
    </>
  );
}

export default App;
